]
const navItems =[
    {
        name: "Projects",
        link: "/project",
        isSelected: true,
    },
    {
        name: "Docs",
        link: "/docs",
        isSelected: false,
    },
    {
        name: "Forums",
        link: "/forums",
        isSelected: false,
