        type: "Instance Segmentation",
        lastEdited: "January 27, 2024",
        thumnailURL: "https://s3-alpha-sig.figma.com/img/3d21/1975/1baf0e0aa42a2ccacdd502ce48e9ecde?Expires=1710115200&Key-Pair-Id=APKAQ4GOSFWCVNEHN3O4&Signature=RTsHe5LNaG6HIFDvJHW79xQFbNxM2tR3Ft8vXfIXqG5cA5Pg5XwbHa0MiK-yWG31VBeQRuAmnBltwdyrG5mjxXoRiSv1r5zJx1eCOi~XQCObw1FuFmYQhSjHQA87tGjUMb99sT4XQy0GV353ed9MWMhk92fTCfzOby1AsCtLwyED4AacRTtnjKolWq~wwMnR8bq9nAwZ5AGmHoiMStZKHWfOZaX40yowZ3Wj5L9rtx85h~Y9Vqwt-d5Se4AF-I2dgJrI2ay3LDOYDaF-nTYwzyWwuwYisVQzYWaY5YcsnZL3VrH52adbiAtydpZgoGH5qOuy5Jk4Iz2~6G154MfJcA__",

